include("matrix.jl")

mutable struct S a :: Int64; end;

SIZE = 30000
table = newarray(SIZE, 0)
pointer = S(0)

function eval_phrase(s)
    n = array_length(s)
    returnForward = newarray(n, -1)
    returnBackward = newarray(n, -1)
    i = 0
    while i < n
        #println(i)
        if s[i] == '>'
            pointer.a = pointer.a + 1;
        elseif s[i] == '<'
            pointer.a = pointer.a - 1;
        elseif s[i] == '+'
            table[pointer.a] = table[pointer.a] + 1;
        elseif s[i] == '-'
            table[pointer.a] = table[pointer.a] - 1;
        elseif s[i] == '.'
            print(char(table[pointer.a]));
        elseif s[i] == ','
            table[pointer.a] = input_int();
        elseif (s[i] == ']' && table[pointer.a] != 0) 
            if returnBackward[i] >= 0 
                i = returnBackward[i]
            else
                j = i
                profondeur = 1
                while (i >= 0 && profondeur > 0)
                    i = i - 1
                    if s[i] == '['
                        profondeur = profondeur - 1;
                    elseif s[i] == ']'
                        profondeur = profondeur + 1;
                    end
                end
                if profondeur > 0
                    println("No matching [. Aborting")
                    return
                end
                returnBackward[j] = i
            end
        elseif s[i] == '[' && table[pointer.a] == 0
            if returnForward[i] >= 0
                i = returnForward[i]
            else
                j = i
                profondeur = 1
                while (i < n && profondeur > 0)
                    i = i + 1
                    if s[i] == '['
                        profondeur = profondeur + 1;
                    elseif s[i] == ']'
                        profondeur = profondeur - 1;
                    end
                end
                if profondeur > 0
                    println("No matching [. Aborting")
                    return
                end;
                returnForward[j] = i
            end
        end;
        i = i + 1
    end
    println()
end

